import axios from "axios";
import React, { useEffect, useState } from "react";

const SimilarMovie = ({ movieId }) => {
  const [data, setData] = useState([]);

  console.log(movieId);

  useEffect(() => {
    axios
      .get(
        `https://api.themoviedb.org/3/movie/693134/recommendations?api_key=864b6602f4018630491e67fa714381e6&query=a&page=1&language=fr-FR`
      )
      .then((res) => console.log(res.data.results));
  }, []);

  return (
    <div>
      <h1>Coucou</h1>
    </div>
  );
};

export default SimilarMovie;
